import React from "react";
import { Route, Switch } from "react-router-dom";
import Home from "../../module/user/components/home/home.user";


const Routing = () => {
  return (
    <Switch>
      <Route exact path="/user" component={Home}/>
    </Switch>
  );
};

export default Routing;
